*
 * This method is like 'defaults' except that it recursively assigns default properties.
 *
 * @param {...Object} sources
 * @return {Object}
 * @example
 *
 * defaultsDeep({ 'a': { 'b': 2 } }, { 'a': { 'b': 1, 'c': 3 } });
 * // => { 'a': { 'b': 2, 'c': 3 } }

